import React from 'react';

export class Auth extends React.Component {
    constructor() {
      super();
      this.state = {
        loggedIn: false,
        loggedInText: "LOGIN"
      };
      let teext = "Okkiiii";
      this.logIn = this.logIn.bind(this);
    }
  
    logIn() {
      this.setState({
        loggedIn: true,
        loggedInText: "LOGGED IN!"
      })
      console.log(this.state);
    }

    componentDidMount(){
      this.teext = "Okkiiii";
      //other stuff below...
    }
}


const auth = new Auth();

export default auth;
